class Dimensions(namedtuple("Dimensions", "name formula "
    "aminoacid neutralloss")):
    '''Subclass with initialization from a dict of modifications'''

    @classmethod
    def fromdict(cls, d):
        counts = {k: max(len(getattr(i, k)) for i in d) for k in cls._fields}
        return cls(**counts)


class SelectedModifications(dict):
    '''Definitions for the selected subset of modifications'''

    def __init__(self, *args, **kwds):
        super(SelectedModifications, self).__init__(*args, **kwds)

        self.setdefault('constant', [])
        self.setdefault('variable', [])


@sequence.serializable('Modification')
class Modification(namedtuple("Modification", "id "
    "name formula aminoacid terminus uncleaved active "
    "type engine neutralloss hidden")):
    '''Configuration object for post-translational modifications'''

    def __new__(cls, id, name, formula, aminoacid='', terminus=TERMINI['null'],
        uncleaved=False, active=False, type=TYPES['Variable'],
        engine=ENGINES['null'], neutralloss='', hidden=0):

        return super(Modification, cls).__new__(cls, id, name, formula,
            aminoacid, terminus, uncleaved, active,
            type, engine, neutralloss, hidden)

    #   PROPERTIES

    @property
    def protein_nterm(self):
        return self.terminus == TERMINI['Protein NTerm']

    @property
    def protein_cterm(self):
        return self.terminus == TERMINI['Protein CTerm']

    @property
    def nterm(self):
        return self.terminus == TERMINI['NTerm']

    @property
    def cterm(self):
        return self.terminus == TERMINI['CTerm']

    @property
    def fragment(self):
        return self.type == TYPES['Crosslinking']

    #    PUBLIC

    def tostr(self):
        '''Returns a formatted name for the modification'''

        aminoacid = ''.join(self.aminoacid.split(','))
        if self.terminus == TERMINI['null']:
            return '{0} ({1})'.format(self.name, aminoacid)
        elif aminoacid:
            return '{0} ({1} {2})'.format(
                self.name, TERMINI(self.terminus), aminoacid)
        else:
            return '{0} ({1})'.format(self.name, TERMINI(self.terminus))

    def isequal(self, other):
        '''Equality implementation that checks if the mod data is equal'''

        return all((
            self.name == other.name,
            self.formula == other.formula,
            self.aminoacid == other.aminoacid,
            self.terminus == other.terminus,
            self.engine == other.engine,
            self.neutralloss == other.neutralloss
        ))

    def gettermindex(self, peptide, position):
        ''''Returns the counts for a terminal modification {0, 1}'''

        if not self.aminoacid:
            return 1

        aminoacids = (i for i in self.aminoacid.split(',') if i)
        if any(i == peptide[position] for i in aminoacids):
            return 1

    def getinternalindex(self, peptide):
        ''''Returns the counts for an internal modification'''

        aminoacids = (i for i in self.aminoacid.split(',') if i)
        for aminoacid in aminoacids:
            for index in (x for x, v in enumerate(peptide) if v == aminoacid):
                yield index + 1


@serialization.register("DatabaseModifications")
class DatabaseModifications(dicttools.StoredNames):
    '''Stores modification with sequential primary keys'''

    modification_error = "Modification not recognized"

    def __init__(self, path, defaults):
        self.engines = defaultdict(list)
        self.__setengines(defaults)
        super(DatabaseModifications, self).__init__(path, defaults)

    #     MAGIC

    def __setitem__(self, key, value, dict_setitem=dict.__setitem__):
        '''si[key] = value -> si[key*] = value'''

        value = self._valuechecker(value)
        key = self._keychecker(key)

        self.names[value.name].append(value.id)
        self.engines[value.engine].append(value.id)
        self.changed[key] = value
        dict_setitem(self, key, value)

    def __delitem__(self, key, dict_delitem=dict.__delitem__, reindex=True):
        '''si[key] -> si[key*] -> value'''

        key = self._keychecker(key, mode=1)
        value = self[key]
        self.changed.pop(key, None)

        self.names[value.name].remove(value.id)
        if not self.names[value.name]:
            del self.names[value.name]

        self.engines[value.engine].remove(value.id)
        if not self.engines[value.engine]:
            del self.engines[value.engine]

        dict_delitem(self, key)
        if reindex:
            self.reindex()

        MODIFICATION_SIGNAL(key)

    #     PROPERTIES

    @property
    def selected(self):
        '''Returns the selected constant and variable modifications'''

        constants = defaults.DEFAULTS['constant_modifications']
        variables = defaults.DEFAULTS['variable_modifications']
        return SelectedModifications({
            'constant': [self[i] for i in constants],
            'variable': [self[i] for i in variables]
        })

    @property
    def dimensions(self):
        return Dimensions.fromdict(self.values())

    #       PUBLIC

    def loaditems(self, *items):
        '''Loads a series of items and returns those found within the db'''

        objects = (Modification.loadjson(i) for i in items)
        indexes = (self.index(i) for i in objects)
        return sorted(i[0] for i in indexes if i)

    def isuncleaved(self, name, engine='null', comp=all):
        '''Returns whether the modification is an uncleaved one'''

        ids = set(self.get_engine(engine)) & set(self.names[name])
        generator = (self[i].uncleaved for i in ids)
        return comp(generator)

    def index(self, modification):
        '''
        Locates a given modification within the object after
        potential changes to the database.
        '''

        modification = self._valuechecker(modification)
        nameids = set(self[modification.name])
        engineids = set(self.get_engine(modification.engine))
        ids = nameids & engineids

        return [i for i in ids if self[i].isequal(modification)]

    #    SETTERS

    def __setengines(self, defaults):
        '''Sets the default engine parameters'''

        if isinstance(defaults, Mapping):
            for value in defaults.values():
                self.engines[value.engine].append(value.id)

        elif isinstance(defaults, list):
            for key, value in defaults:
                self.engines[value.engine].append(value.id)

    #    GETTERS

    def get_engine(self, engine):
        '''Returns the unique IDs for the given engine'''

        if isinstance(engine, six.integer_types):
            return self.engines[engine]
        else:
            return self.engines[ENGINES[engine]]

    #    HELPERS

    def _valuechecker(self, modification):
        '''Checks whether a modification object or a possible object'''

        if isinstance(modification, Modification):
            return modification

        elif isinstance(modification, tuple) and len(modification) == 2:
            args, kwds = modification
            assert len(args) == 2, self.modification_error

            return Modification(self._get_new_key(), *args, **kwds)

        elif isinstance(modification, tuple) and len(modification) >= 2:
            return Modification(self._get_new_key(), *modification)

        else:
            raise AssertionError(self.modification_error)

    def loader(self):
        '''Loads from a target configuration file'''

        document = self._ioload()
        if document is not None:
            keys = sorted(document, key=int)

            for key in keys:
                modification = Modification(*document[key])
                key = int(key)
                self[key] = modification

    def filter(self, engine='null', with_crosslinkers=True):
        '''Returns a filtered mod format'''

        filtered = defaultdict(list)
        for uniprotid, modification in self.items():
            if with_crosslinkers or modification.fragment:
                # TODO: change the check here..
                if engine == 'null' or modification.engine == ENGINES[engine]:
                    filtered[modification.name].append(uniprotid)

        return filtered

